import {
  FETCH_JOBS,
  FETCH_JOBS_ERROR,
  FETCH_JOBS_SUCCESS,
  ADD_JOB,
  ADD_JOB_SUCCESS,
  EDIT_JOB,
  EDIT_JOB_SUCCESS,
  DELETE_JOB,
  DELETE_JOB_SUCCESS,
} from 'store/actionTypes';

import { IJobCard } from 'models';

export const fetchJobs = () => ({
  type: FETCH_JOBS,
});

export const fetchJobsError = () => ({
  type: FETCH_JOBS_ERROR,
});

export const fetchJobsSuccess = (payload: Array<IJobCard>) => ({
  type: FETCH_JOBS_SUCCESS,
  payload,
});

export const addJob = (payload: IJobCard) => ({
  type: ADD_JOB,
  payload,
});

export const addJobSuccess = (payload: IJobCard) => ({
  type: ADD_JOB_SUCCESS,
  payload,
});

export const editJob = (payload: IJobCard) => ({
  type: EDIT_JOB,
  payload,
});

export const editJobSuccess = (payload: IJobCard) => ({
  type: EDIT_JOB_SUCCESS,
  payload,
});

export const deleteJob = (id: number) => ({
  type: DELETE_JOB,
  id,
});

export const deleteJobSuccess = (id: number) => ({
  type: DELETE_JOB_SUCCESS,
  id,
});
